import React, {Profiler} from 'react';
import './App.css';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';
import Clock from './Components/Clock.jsx'

const details = [
  {
    image: "https://cdn02.nintendo-europe.com/media/images/10_share_images/games_15/virtual_console_nintendo_3ds_7/SI_3DSVC_SuperMarioBros.jpg",
    resolver: "(parent, args, context, info) => data",
    tricks: "pagination",
    name: "super mario bros"
  },
  {
    image: "https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg",
    resolver: "(parent, args, context, info) => data",
    tricks: "pagination",
    name: "identity"
  },
  {
    image: "https://github.com/4yerik/images/blob/master/projects/website.PNG?raw=true",
    name: "nothing"
  }

];

const callback = (id, phase, actualTime, baseTime, startTime, commitTime) => {
  // console.log(`${id}'s ${phase} phase:`);
  // console.log(`Actual time: ${actualTime}`);
  // console.log(`Base time: ${baseTime}`);
  // console.log(`Start time: ${startTime}`);
  // console.log(`Commit time: ${commitTime}`);
};

const Projects = () => (
  <div>

    <div className="grid"> 
      
      <div className="item1">
      <Carousel showThumbs={false} useKeyboardArrows={true} dynamicHeight={true} showStatus={false} infiniteLoop={true}>
                <div>
                    {/* <p className="legend">{detail.name}</p>
                    <img className="project-image" src={detail.image}></img> */}
                </div>
                <div>
                    <img src="https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"></img>
                    <p className="legend">Legend 2</p>
                </div>
                <div>
                    <img src="https://www.thesprucepets.com/thmb/LPnj-N-AcGdZRvf7E6y_Hsf2vqo=/4089x2300/smart/filters:no_upscale()/close-up-of-a-hamster-eating-groundnut-635096689-5c525f88c9e77c0001d7c1fa.jpg"></img>
                    <p className="legend">Legend 3</p>
                </div>
            </Carousel>
      </div>
      <div className="item2">

      </div>
      <div className="item3"></div>
      <div className="item4"></div>

    </div>

    <div className="trip">
      <div className="path matte">O</div>
      <div className="path">O</div>
      <div className="path">O</div>
      <div className="path matte">O</div>
      <div className="path">&#128540;</div>
      <div className="path">&#129420;</div>
      <div className="path">kiwi &#129373;</div>
      <div className="path">O</div>
      <div className="path">cake &#127856;</div>
      <div className="path">location &#128205;</div>
      <div className="path">christmas &#127876;</div>
      <div className="path">laptop &#128187;</div>
      <div className="path">luck &#127808;</div>
      <div className="path">backpack &#127890;</div>
      <div className="path">idea &#128161;</div>
      <div className="path">cookie &#127850;</div>
      <div className="path">piano &#127929;</div>
      <div className="path">swimming &#127946;</div>
      <div className="path">O</div>
      <div className="path">hamster &#128057;</div>
      <div className="path">O</div>
      <div className="path">O</div>
      <div className="path">snowboarding &#127938;</div>
      <div className="path">sushi &#127843;</div>
      <div className="path exp">O</div>
      <div className="path">archery &#127919;</div>
      <div className="path">basketball &#127936;</div>
      <div className="path other">O</div>
      <div className="path">rollercoaster &#127906;</div>
      <div className="path foundation">grad &#127891;</div>
    </div>
    {details.map(detail => (
      // <Profiler id="project-page" >
      <div id="project-page" className="project">
        

            <Clock></Clock>
      </div>
      // </Profiler>
    ))
    }
  </div>
);

export default Projects;
